I have a list of items that I want to sort alphabetically. I want to use case-sensative sorting. I have tried the following code but it doesn't work.
var items = ["apple", "Banana", "cherry", "orange"];
items.sort();
console.log(items);
I want the output to be ["apple", "Banana", "cherry", "orange"] but it is ["Banana", "apple", "cherry", "orange"] . How can I fix this?
You can use the localeCompare method to compare strings in a case-sensitive way:
items.sort((a, b) => a.localeCompare(b));
See the MDN documentation for more information.
